// src/App.js
import React from 'react';
import MyNavbar from './components/Navbar'; // Importando o componente da Navbar
import Footer from './components/Footer';   // Importando o componente do Footer
import Curriculum from './components/Curriculum'; // Exibição do Currículo

function App() {
  return (
    <div>
      <MyNavbar />      {/* Barra de navegação superior */}
      <div className="container" style={{ marginTop: '80px' }}>
        <Curriculum />    {/* Exibe o currículo */}
      </div>
      <Footer />        {/* Rodapé */}
    </div>
  );
}

export default App;
